INSERT INTO `libro` VALUES (1,'Teoría y experimentos de Química Orgánica con enfoque de Química Verde','',NULL,'Esta obra se dividida en dos partes la primera sección aborda la conceptualización y la necesidad del cambio hacia la Química Verde en los procesos de transformación química a nivel académico (en los laboratorios de escolares) como en investigación y haciendo énfasis en la aplicación industrial, se resume el origen de la química verde y el surgimiento de los principios fundamentales de ésta. Así mismo en esta sección se integran las bases metodológicas como son el balanceo de ecuaciones y el diseño fundamental de la síntesis orgánica (estrategias y tácticas), así como el desarrollo de cada uno de los principios de química verde.'),(2,'La Industria Mexicana y su Historia. Siglos XVIII, XIX y XX','',NULL,'La historia económica mexicana de los dos últimos siglos plantea una serie de interrogantes: ¿Qué relación se podría establecer entre la primera y segunda Revolución industrial y el proceso de industrialización en México? ¿Qué relación hubo entre la inestabilidad política y el proceso de desarrollo industrial? ¿Qué incidencia tuvieron algunas de las crisis más importantes del sistema capitalista (1848, 1873, 1929 y 1973) sobre las posibilidades de desarrollo industrial? ¿Cuáles han sido las transformaciones fundamentales que tuvo el proceso de industrialización en México durante el periodo 1760-1995? ¿Cuál ha sido la relación entre la industria y la formación del mercado nacional? ¿Cuáles fueron las modalidades de participación del capital nacional y extranjero en la industrialización? ¿Cuáles fueron las barreras o impulsos institucionales que formaron o retardaron la incorporación de la innovación tecnológica a la industria? ¿Cuáles fueron las características del empresariado industrial (origen del capital, experiencia previa en actividades económicas, mentalidad empresarial, áreas de inversión)? Las respuestas a muchas de estas preguntas se exponen con gran lucidez en esta obra de siete investigadores convocados y coordinados por la doctora Ma. Eugenia Romero Sotelo.'),(3,'Diseño de Microprocesadores 2','',NULL,'Esta obra proporciona las bases para el diseño de un microprocesador en el idioma español. Adicionalmente acerca al lector de manera práctica a la metodología del diseño de un microprocesador en un lenguaje de descripción de hardware.'),(4,'Conspiración comunista','','8855555588880','El 68. Conspiración Comunista es una narración sobre dos movimientos sociales en México en 1968, por Arturo Martínez Nateras. La historia es contada con imágenes y vivencias personales. El libro se divide en dos partes: Brillo de Memoria habla sobre la historia movimiento estudiantil. Y la segunda parte, Conspiración Comunista habla sobre dicho movimiento estudiantil y el comunismo.'),(5,'La Constitución de Apatzingán','',NULL,'La Colección Bicentenario de la Constitución de Apatzingán incluye una narración de los hechos históricos que condujeron a la Independencia de México en letra de Jesús Romero Flores.'),(6,'40 años de relación entre México y China','Acuerdos, desencuentros y futuro',NULL,'\"... el presente documento busca lograr una profunda reflexión interdisciplinaria, crítica y constructiva sobre estos últimos cuarenta años de la relación bilateral, con una perspectiva propositiva y hacia el futuro. Con este objetivo se convocó a un grupo significativo de funcionarios, académicos, políticos, empresarios y expertos probablemente uno de los más amplios en la historia de dichos cuarenta años de relación entre ambos países- para mejorar y profundizar el diálogo con base en un análisis compartido que resulte en un conocimiento más profundo y en mejores propuestas para una nueva etapa en la relación entre las dos naciones.\"'),(7,'Lelio','De la amistad',NULL,'Cicerón escribe este diálogo sobre la vejez y usa la figura de Catón el Mayor'),(8,'Catón el Mayor','De la vejez',NULL,'Cicerón escribe este diálogo sobre la vejez y usa la figura de Catón el Mayor'),(9,'El papel de las mujeres como actoras en las Fueras Armadas en América del Norte','',NULL,'La obra aborda la situación de las mujeres en las Fuerzas Armadas en la región de América del Norte de manera comparativa, escrito por las propias mujeres militares y de la Marina. Es una obra pionera en cuanto a que no hay nada escrito sobre este tema.'),(10,'Control de convencionalidad','Estándares del Sistema Interamericano','1234567890123','Se trata de un estudio relativo al control de convencionalidad con base en las sentencias que ha emitido la Corte Interamericana de Derechos Humanos en los casos contenciosos que han sido sometidos a su consideración.'),(11,'Visión de los vencidos otra vez','Relaciones indígenas de la Conquista',NULL,'Textos en español y náhuatl'),(12,'LUZ 2015','',NULL,'año internacional de la luz'),(13,'Crónicas del volcán','no aplica',NULL,'narración de un fenomeo natural'),(14,'La Archivística y la ciencia de la información documental Autonomía e interdependencias','',NULL,'La preocupación epistemológica sobre la naturaleza científica de la Archivística y sus relaciones con las otras disciplinas informativo documentales siempre ha estado presente entre los miembros de la comunidad epistémica de esa disciplina. A lo largo de esta obra se ofrecen distintos acercamientos a esos problemas, defendiendo en unos casos su autonomía completa, en otros una convergencia transdisciplinar de las ciencias informativo-documentales -Archivística, Bibliotecología, Ciencia de la Información, Documentación, Museología. Como en toda obra de carácter filosófico como es ésta que se ocupa de la epistemología de la Archivística, una conclusión última y completa está muy lejos de encontrarse. La riqueza reside en el mismo proceso de búsqueda, reflexión, diálogo, argumentaciones y contra-argumentaciones de posiciones sobre esta problemática. Aunque en el camino indudablemente se van encontrando ideas que todos aceptan, como lo es la necesidad de construir un aparato teórico que contenga conceptos, categorías, modelos y esté alejado de los límites que imponen acercamientos meramente pragmáticos y técnicos, así como de objetos concretos. Asimismo, se concibe la relación de la Archivística con otras disciplinas informativo documentales como muy cercana e interdependiente, pero eso sí, que no es de absorción, subordinación, adición o yuxtaposición.'),(15,'La Archivística y la ciencia de la información documental Autonomía e interdependencias','',NULL,'La preocupación epistemológica sobre la naturaleza científica de la Archivística y sus relaciones con las otras disciplinas informativo documentales siempre ha estado presente entre los miembros de la comunidad epistémica de esa disciplina. A lo largo de esta obra se ofrecen distintos acercamientos a esos problemas, defendiendo en unos casos su autonomía completa, en otros una convergencia transdisciplinar de las ciencias informativo-documentales -Archivística, Bibliotecología, Ciencia de la Información, Documentación, Museología. Como en toda obra de carácter filosófico como es ésta que se ocupa de la epistemología de la Archivística, una conclusión última y completa está muy lejos de encontrarse. La riqueza reside en el mismo proceso de búsqueda, reflexión, diálogo, argumentaciones y contra-argumentaciones de posiciones sobre esta problemática. Aunque en el camino indudablemente se van encontrando ideas que todos aceptan, como lo es la necesidad de construir un aparato teórico que contenga conceptos, categorías, modelos y esté alejado de los límites que imponen acercamientos meramente pragmáticos y técnicos, así como de objetos concretos. Asimismo, se concibe la relación de la Archivística con otras disciplinas informativo documentales como muy cercana e interdependiente, pero eso sí, que no es de absorción, subordinación, adición o yuxtaposición.'),(16,'antología de matematicas','no aplica',NULL,'Textos varios matematicas'),(17,'El león y la virgen','',NULL,'Libro de Ramón López Velarde'),(18,'Manual de procedimiento procesal penal','En el sistema acusatorio',NULL,'La reforma constitucional del 18 de junio de 2008\r\nimplicó la restructuración y reorganización del proceso\r\npenal acusatorio y la implementación de una\r\nserie de principios para fomentar el respeto a los derechos fundamentales\r\ndel acusado. Estas modifi caciones abrieron nuevos\r\ntemas de estudio en materia de derecho procesal en México y\r\nplantearon importantes retos para el aprendizaje y la enseñanza\r\nde esta rama del derecho.\r\nEste Manual de derecho procesal penal tiene como objetivo\r\nproporcionar un material de apoyo a la educación jurídica\r\npara el estudio del proceso penal acusatorio. Se exponen\r\naquí los conceptos básicos del derecho procesal penal y las\r\nprincipales transformaciones que éste ha sufrido hasta su\r\nconstitucionalización. También se incluye el análisis de las\r\ninstituciones y las etapas que conforman el proceso penal\r\nacusatorio. '),(19,'El circuito de los signos ','Una introducción a los estudios culturales',NULL,'Este libro presenta una introducción a los estudios culturales cuyo objetivo es hacer comprender este fenómeno académico que ha irrumpido con fuerza y que integra conceptos y teorías pertenecientes a distintas disciplinas para analizar objetos, coyunturas o acontecimientos particulares, desde una película, un género literario, la recepción de una telenovela, un suceso musical, la compra de objetos de moda, costumbres culinarias o los atentados del 11 de septiembre de 2001. La autora concibió este libro como una herramienta pedagógica para quienes se interesen en el estudio crítico de la cultura popular estadounidense actual, que es hegemónica en los mercados culturales globales. Es por esto que incluye ejercicios y lecturas sugeridas, así como un glosario de terminología teórica.'),(20,'Memo 06102017 01','',NULL,'Reseña de la Memo 06102017 01'),(21,'a','a',NULL,'a'),(22,'b','b',NULL,'b'),(23,'c','',NULL,'c'),(24,'d','',NULL,'d'),(25,'2','',NULL,'2'),(26,'Memo 001','',NULL,'Memo 001'),(27,'Memo 001','',NULL,'Memo 001'),(28,'Memo 001','',NULL,'Memo 001'),(29,'Memo 001','',NULL,'Memo 001'),(30,'Memo 002','',NULL,'Memo 002'),(31,'Memo 002','',NULL,'Memo 002'),(32,'prueba a','',NULL,'aaa'),(33,'prueba a','',NULL,'aaa'),(34,'qqqq','',NULL,'qqqq'),(35,'a','',NULL,'a'),(36,'Revolución','',NULL,'resumen'),(37,'wwww','',NULL,'wwww'),(38,'león','',NULL,'leon'),(39,'Titulo prueba','subtitle',NULL,'At vero eos et accusamus et iusto odio dignissimos ducimus qui blanditiis praesentium voluptatum deleniti atque '),(40,'prueba 2','prueba',NULL,'lkasjddflkjasdlkjf'),(41,'Titulo prueba 3','asdffda',NULL,'asdfadsf'),(42,'prueba encde html','',NULL,'asdfasdf'),(43,'Prueba 4 utf8 encode','',NULL,'asdf'),(44,'Prueba 5 utf8 encode','',NULL,'xfzdfsdafsa'),(45,'prueba 6','',NULL,'jhfjhfjhfjhf');
